import React, {Component} from "react";
import "../Home.module.css"
import logo from "../../../../images/new_лого.png";

import { Link } from 'react-router-dom';

export default class Header extends Component {

    render() {
        return (
            <header>
                <Link to='/'><img src={logo} alt={"logotype"}/></Link>
                <nav className={"navigation"}>
                    <a href="https://ionic.io/ionicons">Home</a>
                    <a href="#">About</a>
                    <a href="#">Services</a>
                    <Link to='/feedback'><a href="#">Feedback</a></Link>
                    <Link to="/signin"><button className={"btnLogin-popup"}>Login</button></Link>
                </nav>
            </header>
        );
    }
}
